const SearchBar = ({keyword,setKeyword}) => {
    const [content, setContent] = useContext(AppContentContext);
    const [search_paradigm, setSearchParadigm] = useContext(AppSearchContext);



    return (
      <input 
       key="searchbar"
       value={keyword}
       placeholder={""}
       onChange={(e) => setKeyword(e.target.value)}
      />
    );
  }
